In an economically recessed climate, Nappy Roots has joined the rest of the nation in trying to understand and work through financial and emotional struggles. No stranger to challenges, this four-man collective from Kentucky tackled their obstacles and, in the process, their self-honest work emerged in form of 5 studio albums and 10 mix-tapes. As usual, Nappy Roots examine our alienable rights, reason, and truth through lyrical originality and voyage.","isMobileFriendly":"true","image":{"jumbo":{"path":"http://cdn.ticketfly.com/i/00/02/31/85/71-atjmbo.jpg","width":960,"height":640},"jumbo1":{"path":"http://cdn.ticketfly.com/i/00/02/31/85/71-atjmbo1.jpg","width":960,"height":540},"large":{"path":"http://cdn.ticketfly.com/i/00/02/31/85/71-atlg.jpg","width":300,"height":200},"large1":{"path":"http://cdn.ticketfly.com/i/00/02/31/85/71-atlg1.jpg","width":300,"height":200},"medium":{"path":"http://cdn.ticketfly.com/i/00/02/31/85/71-atmd.jpg","width":200,"height":133},"medium1":{"path":"http://cdn.ticketfly.com/i/00/02/31/85/71-atmd1.jpg","width":200,"height":133},"original":{"path":"http://cdn.ticketfly.com/i/00/02/31/85/71-og.jpg","width":1105,"height":737},"small":{"path":"http://cdn.ticketfly.com/i/00/02/31/85/71-atsm.jpg","width":100,"height":67},"small1":{"path":"http://cdn.ticketfly.com/i/00/02/31/85/71-atsm1.jpg","width":100,"height":67},"square":{"path":"http://cdn.ticketfly.com/i/00/02/31/85/71-sq.jpg","width":100,"height":100},"squareSmall":{"path":"http://cdn.ticketfly.com/i/00/02/31/85/71-sqsm.jpg","width":60,"height":60},"xlarge":{"path":"http://cdn.ticketfly.com/i/00/02/31/85/71-atxl.jpg","width":500,"height":333},"xlarge1":{"path":"http://cdn.ticketfly.com/i/00/02/31/85/71-atxl1.jpg","width":500,"height":333},"xxlarge":{"path":"http://cdn.ticketfly.com/i/00/02/31/85/71-atxxl.jpg","width":650,"height":434},"xxlarge1":{"path":"http://cdn.ticketfly.com/i/00/02/31/85/71-atxxl1.jpg","width":650,"height":433}},"youtubeVideos":[],"embedAudio":"<iframe width="100%" height="450" scrolling="no" frameborder="no" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/199675543&amp;auto_play=false&amp;hide_related=false&amp;show_comments=true&amp;show_user=true&amp;show_reposts=false&amp;visual=true"></iframe>","embedVideo":"<iframe width="560" height="315" src="https://www.youtube.com/embed/xSs-EhVFBRw" frameborder="0" allowfullscreen></iframe>","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"http://www.nappyroots.com/","urlMySpace":"","urlFacebook":"https://www.facebook.com/nappyrootsmusic","urlTwitter":"http://twitter.com/NappyRoots","twitterScreenName":"NappyRoots"},{"id":1288971,"name":"Dassaro x Jeraff","startTime":null,"eventDescription":"MC/DJ duo Dassaro x Jeraff bring a fresh new twist on the conscious hip-hop sound. The collective came together August 2015 and have blended unique styles of dance infused samples along with hip-hop beats, creating a sound that is individual, energetic and delivers soul. Dassaro carries audiences on lyrical journeys through artistic introspection, party hype and comical analysis on self and relationships. DxJ has made a big name for themselves in the Denver and Colorado music scene. In the last year alone, the duo has shared the stage with a variety of International and National acts such as; Mobb Deep, Sunsquabi, Lafa Taylor, Lyrics Born, Pumpkin, Thriftworks, Jadakiss, Hopsin, Amp Live, Mikey Thunder, Mix Master Mike and many more. DxJ delivers an energetic performance with the heart and naturalness you can expect from a natural lyricist, combined with the rawness and infectious energy that elevates audiences from observers into active participants of the live experience.

