assaro","urlMySpace":"","urlFacebook":"https://www.facebook.com/dassaroofficial","urlTwitter":"","twitterScreenName":""},{"id":271467,"name":"J.O.B. (Just Ova Broke)","startTime":null,"eventDescription":"A Tribe Called Quest tale foretold that in the fall of 10', four music legends would join together and fulfill a musical prophecy.. The four swore that together they could change the musical perception of hip hop forever.. Diggin' in the crates for a little touch of that old school kick, Just Ova Broke is a cross-bridge between a live band set and a straight mc/dj set. Using samples to compliment their live band feel makes them a unique alternative to hip hop in any area. "A little bit of west coast flavor mixed with an east coast mentality demonstrates the different styles J.O.B. possesses, and gives a little foresight into the homage J.O.B. hopes to pay to it's many influences." -UNC Connection Magazine- They are always Just Ova Broke and J.O.B. is a concoction of everything that has ever influenced hip hop in a positive way.. The jams that make you wanna say "Fu-la-la-la" or "I'm cool like that" or "Can I kick it?". J.O.B. has had several opportunities to take their act out of Colorado (New York, Los Angeles, Houston, now Chicago) but have refused to leave until everyone here understands how important changing the scene in Colorado is to J.O.B. They love the C.O. and plan to represent Colorado's relevant, and intelligent hip hop for a long time. After opening for artists like: Redman, Murs, Devin The Dude, Guru's Jazzmatazz, Big Daddy Kane, Del Tha Funky Homospaien, Souls of Mischief, People Under The Stairs, Brother Ali, J-LIVE and many others.. Colorado's finest is beginning to make a name for itself with their phenomenal live performances and intricate style of presenting versions of both past and present hip hop. J.O.B: COMING SOON TO A THEATER NEAR YOU!!","isMobileFriendly":"true","image":{"jumbo":{"path":"http://cdn.ticketfly.com/i/00/01/71/34/41-atjmbo.jpg